import React from 'react';
import styled from 'styled-components';

const LeftContainer = styled.div`
  flex: 1;
  border-right: 1px solid black;
  width: 100%;
  height: 100%;
`;
const Left = () => {
  return (
    <div className="left-container">
      <div className="left-container__content"> Left </div>
    </div>
  );
};

export default Left;
